import React, { Component } from 'react';
import API from '../utils/api';

class News extends Component {
  state = {
    articles: [],
  }

  api = new API();

  componentDidMount = () => {
    this.api.getNews()
      .then(response => {
        return response.json();
      })
      .then(el => {
        this.setState({ articles: el.articles })
      });
  }

  render() {
    const { articles } = this.state;
    console.log(articles);
    return (
      <div className="main-container">
        {articles.map((item) => {
          return (
            <Article {...item}  />
          )
        })}
      </div>
    )
  }
}

export default News;

const Article = ({title, url, publishedAt, content, author}) => {
  return (
    <div className="article-body">
